import { combineReducers } from "redux";

import auth from "./auth";
import quiz from "./quiz";
import project from "./project";
import sudoku from "./sudoku";

export default combineReducers({
  auth: auth,
  quiz: quiz,
  project: project,
  sudoku: sudoku
});
